// App.js
import React, { Suspense } from "react";
import Loadable from "react-loadable";
import "./App.css";
import Price from "../Componets/Price";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Spinner from "react-bootstrap/Spinner";
import { Provider } from "react-redux";
import { store } from "../redux/store";
import ChatbotComponent from "../Componets/ChatbotComponent";
// import ListHistory from "../Componets/ListHistory";

const dynamicImport = (importingComponent) =>
  Loadable({
    loader: importingComponent,
    loading: () => <Spinner animation="grow" />,
  });

const ListHistory = dynamicImport(() => import("../Componets/ListHistory"));

const App = () => {
  return (
        <Container>
          <Row>
            <Col xs={6} md={4}>
              <Chatbot />
            </Col>
          </Row>
        </Container>
  );
};

export default App;
